/**
 * @param {number[]} nums
 * @param {number} target
 * @return {number}
 */
var minSizeSubarray = function(nums, target) {
    let n = nums.length;
    let minLen = Infinity;
    let sum = 0;
    for (let i = 0; i < n; i++) sum += nums[i];
    if (sum < target) return -1;

    let prefixSums = new Array(2 * n + 1).fill(0);
    for (let i = 0; i < 2 * n; i++) {
        prefixSums[i + 1] = prefixSums[i] + nums[i % n];
    }

    for (let i = 0; i < n; i++) {
        let start = i, end = i + n, mid, found = false;
        while (start <= end) {
            mid = Math.floor((start + end) / 2);
            let currSum = prefixSums[mid + 1] - prefixSums[i];
            if (currSum >= target) {
                minLen = Math.min(minLen, mid - i + 1);
                end = mid - 1;
                found = true;
            } else {
                start = mid + 1;
            }
        }
        if (!found) break;
    }

    return minLen === Infinity ? -1 : minLen;
};
